import React, { Component } from "react";
import axios from "axios";

class Game extends Component {
  state = {
    posts: [],
  };

  componentDidMount() {
    axios
      .get("https://jsonplaceholder.typicode.com/posts")
      .then((res) => {
        console.log(res);
      })
      .catch((error) => {
        console.log(error);
      });
  }

  render() {
    return <h1>{this.state.person}</h1>;
  }
}

export default Game;
